import { deleteAllCookies } from "../../helpers/cookie";
import { useEffect } from "react";

function Logout(){

    const navigate= useNavigate();
    deleteAllCookies();


    useEffect(() =>{
        navigate("/login");
    },[])
    return(
        <>
            Page Logout
        </>
    )
}
export default Logout;
